dm = aoc.DataMatrix(input)

origSum = dm.CountVal("@")
lastSum = origSum

while True:
    dm.VisitValue("@", lambda nx, ny: dm.Mark(nx, ny) if (dm.CountNeighborVal(nx, ny, "@") < 4) else None)

    dm.VisitMarks(lambda nx, ny: dm.SetValue(nx, ny, "."))

    newSum = dm.CountVal("@")
    if (newSum == lastSum):
        break
    lastSum = newSum

print(origSum - lastSum)